import React, { useEffect, useState, useRef, useCallback } from "react";
import Axios from "axios";
import {
  Menu, MenuItem, Dialog, DialogTitle, DialogContent, DialogActions, Tabs, Tab, IconButton,
  Button, Container, CssBaseline, Typography, Paper, ThemeProvider
} from '@mui/material';
import { styled } from '@mui/system';
import CloseIcon from '@mui/icons-material/Close';
import MoreVertIcon from '@mui/icons-material/MoreVert';
import FavoriteIcon from '@mui/icons-material/Favorite';
import DirectionsWalkIcon from '@mui/icons-material/DirectionsWalk';
import { APIProvider, AdvancedMarker, Map, Pin } from '@vis.gl/react-google-maps';
import { useNavigate } from 'react-router-dom';

import theme from './Theme/theme';
import logo from './Theme/images/baselogo.jpg';
import walkway0 from './Theme/images/walkway_0.jpg';
import walkway1 from './Theme/images/walkway_1.jpg';
import walkway2 from './Theme/images/walkway_2.jpg';
import walkway3 from './Theme/images/walkway_3.jpg';

// Styled components using MUI's new styled API
const AppContainer = styled(Container)(({ theme }) => ({
  ...theme.root,
  zIndex: 9999,
}));

const Logo = styled('img')(({ theme }) => ({
  position: 'absolute',
  top: theme.spacing(2),
  left: theme.spacing(50),
  width: '200px',
  height: 'auto',
  cursor: 'pointer',
}));

const MapContainer = styled(Paper)(({ theme }) => ({
  height: '600px',
  width: '100%',
  marginTop: theme.spacing(4),
}));

const LogoutButton = styled(Button)({
  position: 'absolute',
  right: 100,
  top: 20,
});

const MoreMenuButton = styled(IconButton)({
  position: 'absolute',
  right: 20,
  top: 20,
});

const WalkerBoard = ({ onLogout }) => {
  const [error, setError] = useState(null);
  const [anchorEl, setAnchorEl] = useState(null);
  const [success, setSuccess] = useState(null);
  const [markers, setMarkers] = useState([]);
  const [selectedMarker, setSelectedMarker] = useState(null);
  const [isFavorite, setIsFavorite] = useState(false);
  const [difficulty, setDifficulty] = useState('Unknown');
  const [tabIndex, setTabIndex] = useState(0);
  const [geojsonData, setGeojsonData] = useState(null);
  const [isMapLoaded, setIsMapLoaded] = useState(false);
  const mapRef = useRef(null);
  const navigate = useNavigate();

  const imageMap = {
    0: walkway0,
    1: walkway1,
    2: walkway2,
    3: walkway3,
  };

  const handleTabChange = (_, newValue) => {
    setTabIndex(newValue);
  };

  const handleLogOut = async () => {
    try {
      await Axios.get("http://localhost:8080/logout");
      if (onLogout) {
        onLogout();
      }
      setSuccess('Log out successful!');
      navigate('/App');
    } catch (error) {
      setError('Log out failed: ' + error.message);
    }
  };

  useEffect(() => {
    const checkFavoriteStatus = async () => {
      if (selectedMarker) {
        try {
          const response = await Axios.get("http://localhost:8080/favorites", { withCredentials: true });
          setIsFavorite(response.data.favorites.some(fav => fav.id === selectedMarker.id));
        } catch (error) {
          console.error("Error checking favorite status:", error);
        }
      }
    };
    checkFavoriteStatus();
  }, [selectedMarker]);

  const handleFavoriteClick = async () => {
    try {
      const response = await Axios.post("http://localhost:8080/addFavorite", { locationId: selectedMarker.id }, { withCredentials: true });
      if (response.status === 200) {
        setSuccess("Marked as favorite!");
        setIsFavorite(true);
        await Axios.post("http://localhost:8080/addPoints", { points: 20 }, { withCredentials: true });
      }
    } catch (error) {
      setError("Failed to mark as favorite: " + error.message);
    }
  };

  const handleMarkerClick = useCallback(async (marker) => {
    setSelectedMarker(marker);
  }, []);

  useEffect(() => {
    const fetchMarkers = async () => {
      try {
        const response = await Axios.get("http://localhost:8080/markers");
        setMarkers(response.data);
      } catch (error) {
        setError('Failed to fetch markers: ' + error.message);
      }
    };
    fetchMarkers();
  }, []);

  const transformedMarkers = markers.map(marker => ({
    ...marker,
    position: { lat: marker.coordinates.latitude, lng: marker.coordinates.longitude },
  }));

  useEffect(() => {
    if (selectedMarker) {
      Axios.get(`http://localhost:8080/getGeojson`, { params: { walkwayId: selectedMarker.id } })
        .then(response => setGeojsonData(response.data.geojson))
        .catch(error => console.error('Error fetching GeoJSON:', error));
    }
  }, [selectedMarker]);

  const handleMapLoad = (mapInstance) => {
    mapRef.current = mapInstance;
    setIsMapLoaded(true);
  };

  useEffect(() => {
    if (isMapLoaded && mapRef.current && geojsonData) {
      const dataLayer = new window.google.maps.Data();
      dataLayer.setMap(mapRef.current);
      dataLayer.addGeoJson(geojsonData);
      dataLayer.setStyle({
        strokeColor: 'blue',
        strokeWeight: 3,
      });

      const bounds = new window.google.maps.LatLngBounds();
      dataLayer.forEach(feature => {
        const geometry = feature.getGeometry();
        geometry.forEachLatLng(latLng => bounds.extend(latLng));
      });

      if (!bounds.isEmpty()) {
        mapRef.current.fitBounds(bounds);
      }
    }
  }, [isMapLoaded, geojsonData]);

  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <AppContainer>
        <APIProvider apiKey={'AIzaSyC8Sj12_rv73anPhi2oCeqsVVjUkfFJ4-U'}>
          <Logo src={logo} alt="logo" onClick={() => navigate('/WalkerBoard')} />
          <MoreMenuButton aria-label="more" onClick={(e) => setAnchorEl(e.currentTarget)}>
            <MoreVertIcon />
          </MoreMenuButton>

          <Menu anchorEl={anchorEl} open={Boolean(anchorEl)} onClose={() => setAnchorEl(null)}>
            <MenuItem onClick={() => navigate('/Profile')}>Profile</MenuItem>
            <MenuItem onClick={() => navigate('/History')}>History</MenuItem>
            <MenuItem onClick={() => navigate('/Favorites')}>Favorites</MenuItem>
          </Menu>

          <MapContainer>
            <Map
              defaultZoom={10}
              defaultCenter={{ lat: 41.5564, lng: -8.16415 }}
              mapId='5f6b01e0c09b0450'
              mapTypeId="terrain"
              onLoad={handleMapLoad}
            >
              {transformedMarkers.map(marker => (
                <AdvancedMarker
                  key={marker.id}
                  position={marker.position}
                  onClick={() => handleMarkerClick(marker)}
                >
                  <Pin />
                </AdvancedMarker>
              ))}
            </Map>
          </MapContainer>

          {selectedMarker && (
            <Dialog open onClose={() => setSelectedMarker(null)}>
              <DialogTitle>
                {selectedMarker?.name}
                <IconButton aria-label="close" onClick={() => setSelectedMarker(null)}>
                  <CloseIcon />
                </IconButton>
              </DialogTitle>
              <Tabs value={tabIndex} onChange={handleTabChange}>
                <Tab label="Overview" />
                <Tab label="Walkway" />
                <Tab label="Services" />
              </Tabs>
              <DialogContent dividers>
                {tabIndex === 0 && (
                  <>
                    <img src={imageMap[selectedMarker?.id]} alt={selectedMarker?.name} style={{ maxWidth: '100%' }} />
                    <Typography>Region: {selectedMarker?.region}</Typography>
                  </>
                )}
                {tabIndex === 1 && (
                  <Map
                    defaultCenter={selectedMarker.defaultCenter}
                    zoom={12}
                    onLoad={handleMapLoad}
                  />
                )}
              </DialogContent>
            </Dialog>
          )}
          <LogoutButton onClick={handleLogOut}>Logout</LogoutButton>
        </APIProvider>
      </AppContainer>
    </ThemeProvider>
  );
};

export default WalkerBoard;
